import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';
import styles from '../css/footer.module.css';

import FacebookIcon from '../img/facebook.svg';
import InstagramIcon from '../img/facebook.svg';
import LinkedinIcon from '../img/facebook.svg';

const Footer = () => {
  return (
    <footer className={styles.footer}>
      <Container>
        <Row>
          <Col md={12} className="text-center">
            <h5>Contact Us</h5>
            <p>Email: example@example.com</p>
            <div className={`social-icons ${styles.socialIcons}`}>
            <a href="enlace-a-tu-perfil-de-Facebook" className={`social-icon ${styles.socialIcon}`}><img src={FacebookIcon} alt="Facebook"  style={{ width: '30px', height: '30px', padding: '10px' }} /></a>
            <a href="enlace-a-tu-perfil-de-Instagram" className={`social-icon ${styles.socialIcon}`}><img src={InstagramIcon} alt="Instagram"  style={{ width: '30px', height: '30px', padding: '10px' }} /></a>
            <a href="enlace-a-tu-perfil-de-LinkedIn" className={`social-icon ${styles.socialIcon}`}><img src={LinkedinIcon} alt="LinkedIn"  style={{ width: '30px', height: '30px', padding: '10px' }} /></a>
            </div>
          </Col>
        </Row>
        <hr className="bg-light" />
        <Row className="text-center">
          <Col>
            <p>&copy; {new Date().getFullYear()} YourWebsite. All Rights Reserved.</p>
          </Col>
        </Row>
      </Container>
    </footer>
  );
};

export default Footer;
